# Function to return a list of words
def get_words():
    """() -> list of words
    
    Returns a list of words.
    
    >>>get_words()
    list of words   
    """
    import requests
    try:
        # set the website url to variable url
        url = 'http://norvig.com/ngrams/sowpods.txt'
        
        # Put the code in exception handling block
        r = requests.get(url)
        r_html = r.text
            
        if '<' in r_html:
            return get_static_words()
         
        return r_html.split(sep = '\r\n')
    except:
        return get_static_words()

# Function to return a random element from a list
def get_random_word(words):
    """(list of str) -> str
    
    Returns a random word from list of words.
    
    >>>get_random_word(words)
    random word from list words   
    """
    import random
    
    return words[random.randint(0,len(words)-1)]

# Function to print hangman
def print_out(word, cor_guess):
    """(str, list of str) -> None
    
    Prints the hangman output string. Returns None. 
    
    >>>print_out('mayhem', [])
    _ _ _ _ _ _ 
    >>>print_out('bliss',['s'])
    _ _ _ s s 
    >>>print_out('bliss',['l','s'])
    _ l _ s s 
    """
    output = ''
    
    # for every character in word, if character is in correct guess 
    # add it to output, if not, add '_ ' instead
    for char in word:
        if char in cor_guess:
            output = output+char+' '
        else:
            output = output+'_ '
    print(output)    
    
# Funtion to check if the input is valid
def check_guess(guess, guess_right, guess_wrong):
    """(char, list of str, list of str) -> bool
    
    Returns True if the input is not valid else returns None.    
    """
    # check to make sure the input is a single character
    if len(guess) != 1 or not(guess.isalpha()):
        print('Incorrect input. Please enter a single character.')
        return True
    # check to make sure the same input is not provided earlier
    elif guess in (guess_right + guess_wrong):
        print('You have already guessed this letter. '
              'Please enter a new letter.')
        print('Letters guessed so far: %s' %(guess_right + guess_wrong))
        return True

# Function to check the result
def get_result(word, guess_right, guess_wrong):
    """
    Prints the result if user gueses the word correctly. Else returns None.

    >>>get_result(word, guess_right, guess_wrong)
    
    """
    # if the list cor_guess has all the characters in word 
    # end the game
    if not [x for x in word if x not in guess_right]:
        print_out(word, guess_right)
        print('Congratulations you won!!\n'
              'It took you %s guesses to guess the right word' 
              %len(guess_right + guess_wrong))
        return True

def main():
    # Print initial greetings
    print('Welcome to Hangman!!\n'
          'Enter exit anytime to terminate the game.\n')
    wins = 0
    lose = 0
    guess_right = []
    guess_wrong = []
    try:
        words
    except NameError:
        words = get_words()
    
    while True:
        if (len(guess_right)+len(guess_wrong)) == 0: 
            # Get new word
            word = get_random_word(words)
            word = word.upper()
            print('All the best!!!\n')
        print_out(word, guess_right)
        guess = input('Guess your letter: ')
        guess = guess.upper()    # Converting the input to uppercase
        if guess == 'EXIT':
            input('Press enter to exit...')
            break
        # check if the input is valid
        elif check_guess(guess, guess_right, guess_wrong):
            continue
        # if the input is in word append it to cor_guess
        elif guess not in word:
            guess_wrong.append(guess)
            print('Sorry. That was incorrect. Please try again.\n'
                  'You have %i attempts left' %(6-len(guess_wrong)))
            if len(guess_wrong) > 6:
                lose = lose + 1
                guess_right = []
                guess_wrong = []
                print('Ah oh. You have lost this round.\n'
                      'You have won %i rounds and lost %i rounds so far'
                      %(wins, lose))
                cont = input('Do you want to continue(Y/N)? ')
                if cont.upper() == 'N':
                    input('Press enter to exit...')
                    break       
        else:
            guess_right.append(guess)
            if get_result(word,guess_right,guess_wrong):
                wins = wins + 1
                guess_right = []
                guess_wrong = []
                print('You have won %i rounds and lost %i rounds so far'
                      %(wins, lose))
                cont = input('Do you want to continue(Y/N)? ')
                if cont.upper() == 'N':
                    input('Press enter to exit...')
                    break      
            
if __name__ == '__main__':
    main()